            setdeleteUserLastName(e.target.value)
          } }/>

          <button onClick={deleteUser}> Delete</button>
          {showDeleteUserList.map((val) => {
          return (
            <div className = "card" id="insertuser">
              <h3>User deleted! </h3>
              <p> User {val.deleteUserFirstName} {val.deleteUserLastName} is deleted! </p>
